import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <Router >
        <div>
          <Header />
          <Route exact path="/" render={() => <Home />} />
          <Route path="/products" render={() => <Product />} />
          <Route path="/company" render={() => <Company />} />
        </div>
      </Router>

    );
  }
}

export default App;
